import React from "react";
import { Link } from "react-router-dom";

const Error = () => {
  return (
    <div>
      <div className="name">ERRO</div>
      <Link to="/">
        <button className="btn primary-btn">Back to Dashboard</button>
      </Link>
    </div>
  );
};

export default Error;
